import React, { useEffect } from 'react'
import { userProfileData } from '../../api/data'



const Feed = () => {
    const [data, setData] = uDeState([])
    const [loading, setLoading] = useState(true)
    const [error, setError] = useState('')


    useEffect(() => {
     const fetchUserProfileData = async () => {
        try {
            const userProfile = await userProfileData();
            setData(userProfile)
        } catch (error) {
            setError('Error fetching user profile')
        } finally {
            setLoading(false)
        }
    };

    }, [])


  return (
    <div className='news-feed-posts'>

    </div>
  )
}

export default Feed
